import React from 'react';
import { AvailabilityEntry } from '../types';

interface ScheduleTableProps {
  data: AvailabilityEntry[];
}

const profileImages: { [key: string]: string } = {
  lisa: 'https://randomuser.me/api/portraits/women/1.jpg',
  aurel: 'https://randomuser.me/api/portraits/men/1.jpg',
  meinrad: 'https://randomuser.me/api/portraits/men/2.jpg',
  herbert: 'https://randomuser.me/api/portraits/men/3.jpg',
  elsie: 'https://randomuser.me/api/portraits/women/2.jpg',
  adelinde: 'https://randomuser.me/api/portraits/women/3.jpg',
};

const countAvailableParticipants = (entry: AvailabilityEntry): number => {
  return Object.values(entry).filter(value => value === true).length;
};

const getStatusIndicatorClass = (availableCount: number): string => {
  if (availableCount >= 4) return 'bg-green-300 text-white';
  if (availableCount === 3) return 'bg-yellow text-white';
  return 'bg-red-300 text-white';
};

const ScheduleTable: React.FC<ScheduleTableProps> = ({ data }) => {
  if (!data || data.length === 0) {
    return <div>No data available</div>;
  }

  const participantNames = Object.keys(data[0]).filter(key => !['id', 'day', 'date'].includes(key));

  return (
    <div className="overflow-x-auto">
      <table className="min-w-full table-fixed border-separate border-spacing-2">
        <thead>
          <tr>
            <th className="w-1"></th>
            <th className="w-10"></th>
            <th className="w-6"></th>
            <th className="w-8"></th>
            <th className="w-14"></th>
            {participantNames.map((name) => (
              <th key={name} className="w-28 text-center py-2">
                <div className="flex flex-col items-center">
                  <div className="flex items-center space-x-1">
                    <div
                      className={`w-4 h-4 rounded-full flex items-center justify-center ${
                        data.some((entry) => entry[name] === true)
                          ? 'bg-green-300 text-green-500'
                          : 'bg-secondary5'
                      }`}
                    >
                      {data.some((entry) => entry[name] === true) && (
                        <span className="text-xs font-primary">✔</span>
                      )}
                    </div>
                    <img
                      src={profileImages[name.toLowerCase()]}
                      alt={name}
                      className="w-8 h-8 rounded-full"
                    />
                  </div>
                  <span className="font-bold mt-1 text-xs">
                    {name.charAt(0).toUpperCase() + name.slice(1)}
                  </span>
                </div>
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((entry) => {
            const availableCount = countAvailableParticipants(entry);
            return (
              <tr key={entry.id} className="align-middle">
                <td className="w-4 flex items-center justify-center py-2">
                  <div
                    className={`w-4 h-4 rounded-full flex items-center justify-center ${getStatusIndicatorClass(availableCount)}`}
                  />
                </td>
                <td className="w-10 text-right py-2 font-bold text-sm text-secondary4">
                  {entry.day.slice(0, 3).toUpperCase()}
                </td>
                <td className="w-6 text-center py-2 font-bold text-secondary3">
                  {typeof entry.date === 'string' ? entry.date.split(' ')[0] : ''}
                </td>
                <td className="w-8 text-left py-2 font-bold text-sm text-secondary4">
                  {typeof entry.date === 'string' ? entry.date.split(' ')[1].toUpperCase() : ''}
                </td>
                <td className="w-14 flex items-center justify-center py-2">
                  <span className="text-secondary3 text-lg font-primary mr-1">✔</span>
                  <span className="text-secondary3 text-lg">{availableCount}</span>
                </td>
                {participantNames.map((name) => (
                  <td
                    key={name}
                    className={`w-28 text-center py-2 ${
                      entry[name] === true
                        ? 'bg-green-300 text-green'
                        : entry[name] === false
                        ? 'bg-secondary5 text-secondary3'
                        : 'bg-secondary5 text-secondary3'
                    }`}
                  >
                    <div className="flex items-center justify-center font-primary ">
                      <span
                        className={`text-lg ${
                          entry[name] === true ? 'text-green-500' : 'text-secondary7'
                        }`}
                      >
                        {entry[name] === true ? '✔' : entry[name] === false ? 'X' : ''}
                      </span>
                    </div>
                  </td>
                ))}
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};

export default ScheduleTable;
